Solution:Here is a solution to the problem. It uses the built-in function `sorted()` to sort the list of numbers in ascending order. Then, it uses the `search()` function from the `collections` module to find the index of the target number. If the target number is not found, the function returns -1.
```python
import collections
def solution(l, num):
    l.sort()
    for i in range(len(l)):
        if l[i] >= num:
            return l.index(l[i])
    return -1
