def count_primes(n):
    """
    Given a positive integer n, return the number of prime numbers less than or equal to n.
    """
    # Initialize a list to store the prime numbers
    prime_list = []

    # Loop from 2 to n
    for i in range(2, n+1):
        # Check if the number is divisible by any number less than or equal to i
        for j in range(2, i):
            if i % j == 0:
                break
        else:
            # If the number is divisible by no number, it is prime
            prime_list.append(i)

    # Return the number of prime numbers
    return len(prime_list)
